import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="animated fadeInUp">
        <div className="header">
          <div id="bitcoinlogo">
            <img src={require('./icons/goldbitcoinicon.png')} />
          </div>
          <div id="title">BitcoinTrans</div>
        </div>
      </div>
    );
  }
}

export default App;
